import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Accordion,
  AccordionSummary,
  AccordionDetails,
  Button,
} from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const API_BASE = 'http://localhost:8000/youtube/';

const VideoComments = () => {
  const [videos, setVideos] = useState([]);
  const [error, setError] = useState(null);

  const fetchComments = async () => {
    try {
      const response = await axios.get(`${API_BASE}comments/`);
      setVideos(response.data);
    } catch (err) {
      console.error('Error fetching comments:', err);
      setError('Failed to fetch video data.');
    }
  };

  useEffect(() => {
    fetchComments();
  }, []);

  return (
    <Box sx={{ p: 4 }}>
      <Typography variant="h4" gutterBottom>
        YouTube Video and Comments Data
      </Typography>

      {error && <Typography color="error">{error}</Typography>}

      {videos.length > 0 ? (
        videos.map((video) => (
          <Accordion key={video.video_id} sx={{ mb: 2 }}>
            <AccordionSummary expandIcon={<ExpandMoreIcon />}>
              <Typography variant="h6">{video.title}</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <Typography variant="subtitle1">
                Views: {video.views} | Likes: {video.likes}
              </Typography>
              <Typography variant="body2">{video.description}</Typography>

              <TableContainer component={Paper} sx={{ mt: 2 }}>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell><strong>Author</strong></TableCell>
                      <TableCell><strong>Comment</strong></TableCell>
                      <TableCell><strong>Likes</strong></TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {video.comments.map((comment) => (
                      <React.Fragment key={comment.comment_id}>
                        <TableRow>
                          <TableCell>{comment.author}</TableCell>
                          <TableCell>{comment.text}</TableCell>
                          <TableCell>{comment.like_count || 0}</TableCell>
                        </TableRow>

                        {/* Display replies */}
                        {comment.replies.map((reply) => (
                          <TableRow key={reply.reply_id}>
                            <TableCell sx={{ pl: 4 }}>{reply.author}</TableCell>
                            <TableCell>{reply.text}</TableCell>
                            <TableCell>-</TableCell>
                          </TableRow>
                        ))}
                      </React.Fragment>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </AccordionDetails>
          </Accordion>
        ))
      ) : (
        <Typography>No videos available</Typography>
      )}
    </Box>
  );
};

export default VideoComments;
